contracts/ProductManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./WhitelistManagement.sol";

contract ProductManagement is WhitelistManagement {

    struct Product {
        string manufacturer;
        uint lotNumber;
        string productName;
        string lotId;
        uint totalProductsInLot;
        address lastOwner;
        uint purchaseDate;
    }

    mapping(string => Product) public products;

    event ProductUpdated(string indexed lotId);

    function addOrUpdateProduct(
        string memory _lotId,
        string memory _manufacturer,
        uint _lotNumber,
        string memory _productName,
        uint _totalProductsInLot,
        address _lastOwner,
        uint _purchaseDate
    ) 
    
    public isWhitelisted {
        products[_lotId] = Product({
            manufacturer: _manufacturer,
            lotNumber: _lotNumber,
            productName: _productName,
            lotId: _lotId,
            totalProductsInLot: _totalProductsInLot,
            lastOwner: _lastOwner,
            purchaseDate: _purchaseDate
        });
        emit ProductUpdated(_lotId);
    }

    function getProduct(string memory _lotId) public view returns (Product memory) {
        return products[_lotId];
    }
}

contracts/WhitelistManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./OwnershipManagement.sol";

contract WhitelistManagement is OwnershipManagement {
    mapping(address => bool) public whitelist;

    event WhitelistUpdated(address indexed participant, bool status);

    modifier isWhitelisted() {
        require(whitelist[msg.sender], "Not whitelisted");
        _;
    }

    function updateWhitelist(address participant, bool isWhitelisted) public onlyOwner {
        whitelist[participant] = isWhitelisted;
        emit WhitelistUpdated(participant, isWhitelisted);
    }
}

contracts/OwnershipManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract OwnershipManagement {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Invalid address");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}

